import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from './routes/home/home.component';

const Shop = () => {
  return(
    <h1>I am Shop</h1>
  )
}

const App = () => {
  return(
  <Routes>
    <Route path='/' element={<Home />}>
      <Route path='/shop' element={<Shop />} />
    </Route>

  </Routes>
  );
};

export default App;
